const filterForm = document.getElementById('filterForm');

const minus = document.querySelectorAll('[data-minus]');
minus.forEach((item) => {
  item.addEventListener('click', () => {
    const filter = item.parentNode.nextElementSibling;
    filter.classList.toggle('d-none');
    item.classList.toggle('fa-plus');
  });
});

const inputs = document.querySelectorAll('.form-control');
const page = document.querySelector('[name=page]');
const price = document.querySelectorAll('[name=price]');
const brand = document.querySelectorAll('[name=brand]');
const rating = document.querySelectorAll('[name=ratingsAverage]');
const cpuManufacture = document.querySelectorAll('[name=cpuManufacture]');
console.log(inputs);

/* 
1) After Every API Call Reload Page - to get the current query Str.
2) On Next API Call add on the previous queryStr.
    a)TO add on - validate all inputs which are all checked.
    b) Based on the Checked value form a queryStr.
    c) Reload is to form queryStr based on the current checked value.
    d) Add On the QueryStr to URl as query
3) 

*/

let query = [];
inputs.forEach((input) => {
  if (input.checked) {
    let operator;
    if (input.name === 'price' && input.id === 'lte') {
      operator = 'lte';
      console.log(`${input.name}[${operator}]=${input.value}&`);
      query.push(`${input.name}[${operator}]=${input.value}&`);
    } else if (input.name === 'price' && input.id !== 'lte') {
      operator = 'gte';
      console.log(`${input.name}[${operator}]=${input.value}&`);
      query.push(`${input.name}[${operator}]=${input.value}&`);
    } else if (input.name === 'ratingsAverage') {
      operator = 'gte';
      console.log(`${input.name}[${operator}]=${input.value}&`);
      query.push(`${input.name}[${operator}]=${input.value}&`);
    } else {
      console.log(`${input.name}=${input.value}&`);
      query.push(`${input.name}=${input.value}&`);
    }
  }
});

const queryStr = query.join('');
console.log(query, 'From Query');
console.log(queryStr, 'From QueryStr');

//if the selectedIndex > 0 , means select option is changed

class APICalls {
  constructor() {
    this.url = `http://127.0.0.1:4500/api/v1/products?limit=5`;
    this.query;
    this.data = [];
  }

  getAllProducts = () => {
    fetch(`${this.url}`)
      .then((res) => res.json())
      .then((data) => console.log(data))
      .catch((err) => console.log(err));
  };

  pagination = (Num) => {
    fetch(`http://127.0.0.1:4500/api/v1/products?limit=5&page=${Num}`)
      .then((res) => res.json())
      .then((data) => console.log(data))
      .catch((err) => console.log(err));
  };

  price = (operator, price) => {
    fetch(
      `http://127.0.0.1:4500/api/v1/products?limit=5&price[${operator}]=${price}`
    )
      .then((res) => res.json())
      .then((Data) => {
        console.log(Data);
        location.reload();
      })
      .catch((err) => console.log(err));
  };

  brand = (brandQuery) => {
    fetch(`http://127.0.0.1:4500/api/v1/products?limit=5&${brandQuery}`)
      .then((res) => res.json())
      .then((data) => console.log(data))
      .catch((err) => console.log(err));
  };

  rating = (rating) => {
    fetch(
      `http://127.0.0.1:4500/api/v1/products?limit=5&ratingsAverage[gte]=${rating}`
    )
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
        location.reload();
      })
      .catch((err) => console.log(err));
  };

  cpuManufacture = (cpuManufacture) => {
    fetch(
      `http://127.0.0.1:4500/api/v1/products?cpuManufacturer=${cpuManufacture}`
    )
      .then((res) => res.json())
      .then((data) => console.log(data))
      .catch((err) => console.log(err));
  };
}

const fetchProducts = new APICalls();

page.addEventListener('change', (e) => {
  console.log(e.target);
  fetchProducts.pagination(e.target.value);
});

price.forEach((price) => {
  price.addEventListener('change', (e) => {
    console.log('clicked');
    if (e.target.id === 'lte') fetchProducts.price('lte', e.target.value);
    else fetchProducts.price('gte', e.target.value);
  });
});

let brandNames = [];
brand.forEach((brand) => {
  brand.addEventListener('change', (e) => {
    if (e.target.checked) brandNames.push(`brand=${e.target.value}`);
    const brandQuery = brandNames.join('&');
    fetchProducts.brand(brandQuery);
  });
});

rating.forEach((rating) => {
  rating.addEventListener('change', (e) => {
    fetchProducts.rating(e.target.value);
  });
});

cpuManufacture.forEach((cpuManu) => {
  cpuManu.addEventListener('change', (e) => {
    fetchProducts.cpuManufacture(e.target.value);
  });
});

